import React, { useState, useEffect, useRef } from "react";

function App() {
  const [messages, setMessages] = useState([]);
  const [input, setInput] = useState("");
  const [isTyping, setIsTyping] = useState(false);
  const [connectionStatus, setConnectionStatus] = useState("checking");

  const chatEndRef = useRef(null);

  // Check backend connection on load
  useEffect(() => {
    checkConnection();
  }, []);

  // Auto scroll to bottom
  useEffect(() => {
    chatEndRef.current?.scrollIntoView({ behavior: "smooth" });
  }, [messages]);

  const checkConnection = async () => {
    try {
      const response = await fetch('http://localhost:5000/api/health');
      const data = await response.json();
      setConnectionStatus(data.ai_ready ? "connected" : "no-ai");
    } catch (error) {
      setConnectionStatus("disconnected");
      console.error("Connection error:", error);
    }
  };

  const sendMessage = async () => {
    if (!input.trim()) return;

    const userMessage = { text: input, sender: "user" };
    setMessages(prev => [...prev, userMessage]);
    setInput("");
    setIsTyping(true);

    try {
      const response = await fetch('http://localhost:5000/api/chat', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ message: input })
      });

      const data = await response.json();

      if (data.status === "success") {
        setMessages(prev => [...prev, { text: data.message, sender: "bot" }]);
      } else {
        setMessages(prev => [...prev, { 
          text: "‚ö†Ô∏è " + data.message, 
          sender: "bot", 
          isError: true 
        }]);
      }
    } catch (error) {
      setMessages(prev => [...prev, { 
        text: "‚ö†Ô∏è Connection error. Please make sure the backend server is running.", 
        sender: "bot", 
        isError: true 
      }]);
      setConnectionStatus("disconnected");
    } finally {
      setIsTyping(false);
    }
  };

  const clearChat = async () => {
    try {
      await fetch('http://localhost:5000/api/chat/clear', {
        method: 'POST'
      });
      setMessages([]);
    } catch (error) {
      console.error("Error clearing chat:", error);
    }
  };

  const renderConnectionStatus = () => {
    switch (connectionStatus) {
      case "connected":
        return <div className="status connected">‚úÖ Connected to AI</div>;
      case "no-ai":
        return <div className="status warning">‚ö†Ô∏è Connected but no AI API key</div>;
      case "disconnected":
        return <div className="status error">‚ùå Backend disconnected</div>;
      default:
        return <div className="status checking">üîç Checking connection...</div>;
    }
  };

  return (
    <div className="app-container">
      <header className="app-header">
        <h1>üåô MoodMate Chat Test</h1>
        {renderConnectionStatus()}
        <button onClick={clearChat} className="clear-btn">
          Clear Chat
        </button>
      </header>

      <div className="chat-container">
        <div className="chat-messages">
          {messages.length === 0 ? (
            <div className="welcome-message">
              <p>Hello! I'm MoodMate, your mental health companion. How are you feeling today?</p>
              <p>This is a test version without login or other features.</p>
            </div>
          ) : (
            messages.map((msg, index) => (
              <div key={index} className={`message ${msg.sender} ${msg.isError ? 'error' : ''}`}>
                <div className="message-content">
                  {msg.text}
                </div>
              </div>
            ))
          )}

          {isTyping && (
            <div className="message bot typing">
              <div className="message-content">
                Thinking...
              </div>
            </div>
          )}

          <div ref={chatEndRef}></div>
        </div>

        <div className="chat-input">
          <input
            type="text"
            placeholder="Type your message here..."
            value={input}
            onChange={(e) => setInput(e.target.value)}
            onKeyDown={(e) => e.key === 'Enter' && sendMessage()}
            disabled={connectionStatus === "disconnected"}
          />
          <button 
            onClick={sendMessage} 
            disabled={!input.trim() || connectionStatus === "disconnected"}
          >
            Send
          </button>
        </div>
      </div>

      <div className="instructions">
        <h3>Testing Instructions:</h3>
        <ol>
          <li>Make sure backend is running on port 5000</li>
          <li>Add your Gemini API key to the .env file</li>
          <li>Start typing to test the chatbot</li>
          <li>Check console for any errors</li>
        </ol>
      </div>
    </div>
  );
}

export default App;
